import React from "react";
import style from "./reports.module.css";
import AutoAwesomeIcon from "@mui/icons-material/AutoAwesome";

/**
 * 
 * A component that returns the user's report data.
 */

function Reports() {
  return (
    <div className={`container ${style["size23"]}`}>
      <div className="row justify-content-center">
        <p className={style["part2"]}>
          <AutoAwesomeIcon />
          <span>על מנת לשפר את ניתוח הדוח מומלץ להוסיף את הפרטים הבאים</span>
        </p>
        <div className={style["mini-card"]}>
          <p>מאגרי סנקציות</p>
          <span>מומלץ להוסיף שם פרטי ושם משפחה באנגלית</span>
        </div>
        <div className={style["mini-card"]}>
          <p>מאגרי מקלט מס </p>
          <span> לא סופק שם באנגלית</span>
        </div>
        <div className={style["mini-card"]}>
          <p>מאגרי מבוקשים בינלאומיים </p>
          <span>לא סופק שם באנגלית</span>
        </div>
      </div>
    </div>
  );
}

export default Reports;
